import React from 'react';
import { Button } from 'react-bootstrap';

const loginButton = (props) => (
        props.loggedIn ? <div className="loginName">Kevin Holt</div> 
        : <Button href="http://localhost:8888" variant="nav">Login to Spotify</Button>
);

export default loginButton;
